import React from 'react';

const Education = () => {
  return (
    <div name='education' className='w-full h-screen bg-[#000000] text-gray-300'>
      <div className='flex flex-col justify-center items-center w-full h-full'>
        <div className='max-w-[1200px] w-full  gap-8'>
          <div className='sm:text-center pb-8 pl-4'>
            <p className='text-4xl font-bold inline border-b-4 border-pink-600'>
              EDUCATION AND EXPERIENCE
            </p>
            <div className="education-content">
                        <div className="border border-sky-500 p-" >
                            <div className="year"><i className='bx bx-calendar'></i>2019-2023</div>
                            <h3>BTECH - Information Technology</h3>
                            
                        </div>
                    </div>
          </div>
          <div></div>
        </div>
       
      </div>
    </div>
  );
};

export default Education;
